    "description": "Wi-Fi is free, and guests are within walking distance of cafes, shops and public transportation, at the non-smoking Best Western Premier Opera Faubourg. The traditional exterior of the seven-story Best Western gives way to a quirky lobby with playful furnishings. All 101 comfortably appointed rooms come with free Wi-Fi, flat-panel TVs, coffeemakers and minibars. Guests purchase breakfast and then confer with the concierge to plan adventures. Ask at the 24-hour front desk for help with business services. There's a bar on-site, and parking is available. The Best Western is in the 9th Arrondissement, surrounded by small cafes, shops and residential apartments. It's a three-minute walk from the metro and 15 minutes by foot from the Gare du Nord station. The legendary Paris Opera House is 10 minutes by foot, or walk 20 minutes to the iconic Sacre-Couer Basilica. Famous sights including the Eiffel Tower, Notre-Dame and the Arc de Triomphe are less than three miles away. Take time to admire the city's incredible art at the Louvre, Musee de l'Orangerie and Musee d'Orsay, all within two miles. Charles de Gaulle Airport is a 14-mile drive. The Best Western is in a \"great central location,\" say Priceline guests, who also note the staff's \"excellent and professional\" service and the hotel's \"cute boutique\" ambiance. ",
